import React from 'react';
import RealTimeDataDisplay from './RealTimeDataDisplay';
import './dashboard.css'; // for styling

function Dashboard() {
    return (
        <div className="dashboard-container">
            <h2>Electricity Data Dashboard</h2>
            <RealTimeDataDisplay />
        </div>
    );
}

export default Dashboard;
